'use strict';

const keyList = [];
function collectKeys(k, v){
	if(k && !(Array.isArray(this) || keyList.includes(k)))keyList.push(k);
	return v;
}
module.exports = function(target){
	JSON.stringify(target, collectKeys);
	const result = JSON.stringify(target, keyList.sort());
	keyList.length = 0;
	return result;
}
